import React from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import Card from 'react-bootstrap/Card'

function Main() {
    return(
        <Card className="shadow" style={cardStyle}>
            <Card.Body>
                Haison Nguyen
            </Card.Body>
        </Card>
    )
}

const cardStyle = {
    position: "absolute",
    top: "0%",
    left: "50%"
}
export default Main;
